import React from 'react'
import Item from './Item'

function ItemList() {
  const a = [
    'ваы',
    'fhgfh',
    'dndm,gj fj'
  ]

  return (
    <div>
      {a.map((item, index) =>
        <Item key={index} name={item}></Item>
      )}
    </div>
  )
}

export default ItemList
